$(function() {

	var url	= window.location.href;
	var nonCached = [];

	$( "nocache" ).each(function( index ) {
		nonCached.push(this);
	});

	for ( var i = 0; i < nonCached.length; i = i + 1 ) {
		var element = $( "nocache:eq("+i+")" );

		var height = element.outerHeight(true);
		var width = element.outerWidth(true);

		//element.html('<div style="width:'+width+'px;height:'+height+'px;text-align:center;"><img style="max-height: 45px; max-width:45px;text-align:center; vertical-align:center;" src="data:image/gif;base64,"/></div>');
	}

	$.ajax({
   		url: url,
   		headers: { 'X-Nocache': 'true' }
	}).done(function( data ) {
    	for ( var i = 0; i < nonCached.length; i = i + 1 ) {
			var test = $(data).find('nocache').eq(i);
			$( "nocache:eq("+i+")" ).html(test.html());
		}
  	});

});